import { EMPTY } from 'rxjs';
import { mergeMap, filter } from 'rxjs/operators';
import { isActionOf } from 'typesafe-actions';
import { signupReceivedEvent } from '../events';

const signupReceivedEpic = (action$, state$) => action$.pipe(filter(isActionOf(signupReceivedEvent)), mergeMap(() => EMPTY));

export default [signupReceivedEpic];
